import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import SwiperCore, { EffectCube, Navigation, Autoplay, Pagination } from 'swiper';
import './Slider.css';
import 'swiper/swiper.scss';
import 'swiper/components/effect-cube/effect-cube.scss';
import 'swiper/components/navigation/navigation.scss';
import { Button } from 'react-bootstrap';
import Vid from './assets/vid-main.mp4';

SwiperCore.use([EffectCube, Navigation, Autoplay, Pagination]);

export default () => {
  return (
    <Swiper 
        effect="cube"
        navigation
        autoplay={{ delay: 5000 }}
        pagination={{ clickable: true }}
        onSlideChange={() => console.log('slide change')}
        className='cube'>

      <SwiperSlide className='slide'>
      <h1>Hello, my name is Charlie,</h1>
      <p>I am a JavaScript developer with a passion for UI design. I have experience working with React, Node & Vanilla JS. Below you can view some examples of my work.</p>
      <Button>ENTER 3D SITE</Button>
      <h1>SWIPE RIGHT TO VIEW PROJECTS</h1>
      </SwiperSlide>
      <SwiperSlide className='slide'>
        <h1>Project title</h1>
        <p>I am a JavaScript developer with a passion for UI design. I have experience working with React, Node & Vanilla JS. Below you can view some examples of my work.</p>
        <video autoPlay loop muted><source src={Vid} type='video/mp4'/></video>
        </SwiperSlide>
      <SwiperSlide className='slide'><h1>hello</h1></SwiperSlide>
      <SwiperSlide className='slide'><h1>hello</h1></SwiperSlide>
    </Swiper>
  );
};
